// src/pages/BusinessSolutionsPage.js
import React from 'react';
import './BusinessSolutionsPage.css';
import businessSolutionsImage from './images/business-solutions.jpg';

const BusinessSolutionsPage = () => {
  return (
    <div className="business-solutions-page">
      <h1>Business Solutions</h1>
      <img src={businessSolutionsImage} alt="Business Solutions" className="header-image" />
      <div className="content">
        <section>
          <h2>Our Concept</h2>
          <p>Our business solutions are designed to help companies thrive in a competitive market. We offer a range of services tailored to meet the unique needs of each client.</p>
        </section>
        <section>
          <h2>Professionalism</h2>
          <blockquote>We pride ourselves on our professional approach, ensuring that every client receives personalized and efficient service.</blockquote>
        </section>
      </div>
    </div>
  );
};

export default BusinessSolutionsPage;
